PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE alembic_version (
	version_num VARCHAR(32) NOT NULL, 
	CONSTRAINT alembic_version_pkc PRIMARY KEY (version_num)
);
CREATE TABLE users (
	id INTEGER NOT NULL, 
	name VARCHAR, 
	email VARCHAR, 
	password VARCHAR, 
	state BOOLEAN, 
	last_login DATETIME, 
	access_level VARCHAR, created_at DATETIME, updated_at DATETIME, url VARCHAR, alert BOOLEAN, 
	PRIMARY KEY (id)
);
CREATE TABLE endpoints (
	id INTEGER NOT NULL, 
	ip VARCHAR, 
	interval INTEGER, 
	version VARCHAR, 
	community VARCHAR, 
	port INTEGER, 
	user VARCHAR, 
	"authKey" VARCHAR, 
	"privKey" VARCHAR, 
	id_usuario INTEGER, nickname VARCHAR, active BOOLEAN, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id_usuario) REFERENCES users (id)
);
CREATE TABLE endpoints_data (
	id INTEGER NOT NULL, 
	id_end_point INTEGER, 
	status BOOLEAN, 
	last_updated DATETIME, "sysDescr" TEXT, "sysName" VARCHAR, "sysUpTime" VARCHAR, "hrProcessorLoad" VARCHAR, "memTotalReal" VARCHAR, "memAvailReal" VARCHAR, "hrStorageSize" VARCHAR, "hrStorageUsed" VARCHAR, "ifOperStatus" VARCHAR, "ifInOctets" VARCHAR, "ifOutOctets" VARCHAR, "hrStorageDescr" VARCHAR, ping_rtt VARCHAR, snmp_rtt VARCHAR, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id_end_point) REFERENCES endpoints (id)
);
CREATE TABLE endpoints_oids (
	id INTEGER NOT NULL, 
	id_end_point INTEGER, 
	"sysDescr" TEXT, 
	"sysName" VARCHAR, 
	"sysUpTime" VARCHAR, 
	"hrProcessorLoad" VARCHAR, 
	"memTotalReal" VARCHAR, 
	"memAvailReal" VARCHAR, 
	"hrStorageSize" VARCHAR, 
	"hrStorageUsed" VARCHAR, "ifOperStatus" VARCHAR, "ifInOctets" VARCHAR, "ifOutOctets" VARCHAR, "hrStorageDescr" VARCHAR, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id_end_point) REFERENCES endpoints (id)
);
CREATE TABLE alert_rules (
	id INTEGER NOT NULL, 
	name VARCHAR(255) NOT NULL, 
	description TEXT, 
	condition TEXT NOT NULL, 
	severity VARCHAR(50) NOT NULL, 
	category VARCHAR(50) NOT NULL, 
	is_active BOOLEAN, 
	id_user_created INTEGER NOT NULL, 
	created_at DATETIME, 
	updated_at DATETIME DEFAULT (CURRENT_TIMESTAMP), 
	PRIMARY KEY (id), 
	FOREIGN KEY(id_user_created) REFERENCES users (id)
);
CREATE TABLE alerts (
	id INTEGER NOT NULL, 
	title VARCHAR(255) NOT NULL, 
	description TEXT, 
	severity VARCHAR(50) NOT NULL, 
	status VARCHAR(50) NOT NULL, 
	category VARCHAR(50) NOT NULL, 
	impact VARCHAR(50) NOT NULL, 
	system VARCHAR(255) NOT NULL, 
	assignee VARCHAR(255), 
	id_endpoint INTEGER, 
	id_user_created INTEGER NOT NULL, 
	id_user_assigned INTEGER, 
	created_at DATETIME NOT NULL, 
	updated_at DATETIME DEFAULT (CURRENT_TIMESTAMP) NOT NULL, 
	acknowledged_at DATETIME, 
	resolved_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id_endpoint) REFERENCES endpoints (id), 
	FOREIGN KEY(id_user_assigned) REFERENCES users (id), 
	FOREIGN KEY(id_user_created) REFERENCES users (id)
);
CREATE TABLE alert_logs (
	id INTEGER NOT NULL, 
	id_alert INTEGER NOT NULL, 
	id_user INTEGER NOT NULL, 
	action VARCHAR(100) NOT NULL, 
	comment TEXT, 
	created_at DATETIME NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id_alert) REFERENCES alerts (id), 
	FOREIGN KEY(id_user) REFERENCES users (id)
);
CREATE TABLE email_config (
	id INTEGER NOT NULL, 
	email VARCHAR NOT NULL, 
	password VARCHAR NOT NULL, 
	port INTEGER NOT NULL, 
	server VARCHAR NOT NULL, 
	created_at DATETIME, 
	updated_at DATETIME DEFAULT (CURRENT_TIMESTAMP), active BOOLEAN, 
	PRIMARY KEY (id)
);
CREATE TABLE failure_threshold_config (
	id INTEGER NOT NULL, 
	consecutive_snmp_failures INTEGER, 
	consecutive_ping_failures INTEGER, 
	active BOOLEAN, 
	created_at DATETIME, 
	updated_at DATETIME DEFAULT (CURRENT_TIMESTAMP), 
	PRIMARY KEY (id)
);
CREATE TABLE webhook_config (
	id INTEGER NOT NULL, 
	url VARCHAR NOT NULL, 
	active BOOLEAN, 
	created_at DATETIME, 
	updated_at DATETIME DEFAULT (CURRENT_TIMESTAMP), timeout INTEGER, access_token VARCHAR, 
	PRIMARY KEY (id)
);
CREATE TABLE performance_thresholds (
	id INTEGER NOT NULL, 
	metric_type VARCHAR(50) NOT NULL, 
	warning_threshold INTEGER NOT NULL, 
	critical_threshold INTEGER NOT NULL, 
	enabled BOOLEAN, 
	created_at DATETIME, 
	updated_at DATETIME DEFAULT (CURRENT_TIMESTAMP), 
	PRIMARY KEY (id)
);
CREATE TABLE sla_metrics (
	id INTEGER NOT NULL, 
	endpoint_id INTEGER NOT NULL, 
	timestamp DATETIME DEFAULT CURRENT_TIMESTAMP NOT NULL, 
	availability_percentage FLOAT NOT NULL, 
	uptime_seconds INTEGER, 
	downtime_seconds INTEGER, 
	mttr_minutes FLOAT, 
	mtbf_hours FLOAT, 
	incidents_count INTEGER, 
	sla_target FLOAT, 
	sla_compliance BOOLEAN NOT NULL, 
	sla_breach_minutes FLOAT, 
	avg_response_time FLOAT, 
	max_response_time FLOAT, 
	min_response_time FLOAT, 
	measurement_period_hours INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(endpoint_id) REFERENCES endpoints (id)
);
CREATE TABLE incidents (
	id INTEGER NOT NULL, 
	endpoint_id INTEGER NOT NULL, 
	alert_id INTEGER, 
	incident_type VARCHAR(50) NOT NULL, 
	severity VARCHAR(50), 
	status VARCHAR(50), 
	start_time DATETIME DEFAULT CURRENT_TIMESTAMP NOT NULL, 
	end_time DATETIME, 
	duration_seconds INTEGER, 
	root_cause TEXT, 
	impact_description TEXT, 
	resolution_notes TEXT, 
	detected_by VARCHAR(100), 
	resolved_by INTEGER, 
	response_time_minutes FLOAT, 
	resolution_time_minutes FLOAT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(endpoint_id) REFERENCES endpoints (id), 
	FOREIGN KEY(alert_id) REFERENCES alerts (id), 
	FOREIGN KEY(resolved_by) REFERENCES users (id)
);
CREATE TABLE performance_metrics (
	id INTEGER NOT NULL, 
	endpoint_id INTEGER NOT NULL, 
	timestamp DATETIME DEFAULT CURRENT_TIMESTAMP NOT NULL, 
	response_time_p50 FLOAT, 
	response_time_p90 FLOAT, 
	response_time_p95 FLOAT, 
	response_time_p99 FLOAT, 
	response_time_p99_9 FLOAT, 
	response_time_avg FLOAT, 
	response_time_max FLOAT, 
	response_time_min FLOAT, 
	error_rate_percentage FLOAT, 
	total_requests INTEGER, 
	failed_requests INTEGER, 
	requests_per_second FLOAT, 
	throughput_mbps FLOAT, 
	jitter_ms FLOAT, 
	packet_loss_rate FLOAT, 
	measurement_period_minutes INTEGER, 
	sample_count INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(endpoint_id) REFERENCES endpoints (id)
);
DELETE FROM sqlite_sequence;
COMMIT;
